# Функция для генерации кортежей для таблицы "delays"
def generate_delay_tuples(flight_control_data, delay_ref_data):
    delay_tuples = []
    for flight in flight_control_data:
        if flight["delta_t"] > 0:
            # Выбираем случайную задержку из delay_ref_data
            delay = random.choice(delay_ref_data)
            # Генерируем значение для столбца airport
            airport = random.choice(["Выпускающий", "Принимающий"])
            delay_tuples.append({
                "id_flights": flight["id"],
                "code_delay": delay["code_delay"],
                "airport": airport
            })
    return delay_tuples

